long_desc.thetext:
Some of the failures are of this kind:

public class X {
	void a(boolean b, Object... o) {
		System.out.print(1);
	}

	void a(Object... o) {
		System.out.print(2);
	}

	public static void main(String[] args) {
		X x = new X();
		x.a(true);
	}
}

Expected: The method a(boolean, Object[]) is ambiguous for the type X

Actual: The method a(Object[]) is ambiguous for the type X

I guess both are equally acceptable results.
